import './skills.scss';
import { FC } from 'react';

export const Skills:FC = () => {
    return (
        <div className='skills'>
            <h2>skills</h2>
            <div className="skills-list">
                <div className="skills-list__item">
                    <span className="skill-list__item"> typescript</span>
                </div>
                <div className="skills-list__item">
                    <span className="skill-list__item"> react</span>
                </div>
                <div className="skills-list__item">
                    <span className="skill-list__item"> angular</span>
                </div>
            </div>
        </div>

    )
}
